                setShowDetails(true);
                console.log('성공:', response.data);
                console.log( response.data.result.petName);

            })
            .catch(error => {
                console.error('에러 발생:', error);
            });
            
    };


    return (
        <div className="main_R">
            <div>{data.petName}</div>
            <div className="ment">
                <p className="detail">예약상세</p>
                <a className="save" href="#" onClick={handleShowDetails}>저장내용불러오기</a>
            </div>

            <div className="table_box">
                <table className="table tablee"  >
                    <thead>
                        <tr>
                            <th scope="col" style={{ background: '#F5F5F5', width: 213 }}>반려동물 이름</th>
                            <th scope="col" style={{ width: 277 }}>{showDetails && (<p>{data.result.petName}</p>)}</th>
                            <th scope="col" style={{ background: '#F5F5F5', width: 344 }}>이름</th>
                            <th scope="col" style={{ width: 277 }}>{showDetails && (<p>{data.result.name}</p>)}</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <th scope="row" style={{ background: '#F5F5F5' }}>반려동물 종류</th>
                            <td>{showDetails && (<p>{data.species}</p>)}</td>
                            <td style={{ background: '#F5F5F5' }}>전화번호</td>
                            <td>{showDetails && (<p>{data.result.telephone}</p>)}</td>
                        </tr>
                        <tr>
                            <th scope="row" style={{ background: '#F5F5F5' }}>반려동물 성별</th>
                            <td>{showDetails && (<p>{data.result.gender}</p>)}</td>
                            <td style={{ background: '#F5F5F5' }}>주소</td>
                            <td>{showDetails && (<p>{data.result.address}</p>)}</td>
                        </tr>
                        <tr>
                            <th scope="row" rowSpan="3" style={{ background: '#F5F5F5' }}>메뉴선택</th>
                            <td colSpan="3">

                                <RadioGroup>
                                    <Radio name="species" value="small" >중,소형견</Radio>
                                    <Radio name="species" value="big">대형견</Radio>
                                </RadioGroup>


                            </td>
                        </tr>

                        <tr>
                            <td colSpan="3">
                                <RadioGroup>
                                    <Radio name="cut" value="1" >가위컷</Radio>
                                    <Radio name="cut" value="2">기계컷</Radio>
                                    <Radio name="cut" value="3">스포팅</Radio>
                                    <Radio name="cut" value="4" >클리핑</Radio>
                                    <Radio name="cut" value="5" >부분미용</Radio>
                                </RadioGroup>
                            </td>
                        </tr>

                        <tr>
                            <td colSpan="3">
                                <RadioGroup>
                                    <Radio name="bath" value="bagic" >목욕</Radio>
                                    <Radio name="bath" value="healing">힐링스파</Radio>
                                    <Radio name="bath" value="carbonic acid">탄산스파</Radio>
                                </RadioGroup>
                            </td>
                        </tr>
                    </tbody>
                </table>
            </div>

            <button className="next" onClick={handleNextClick}>다음</button>
        </div>

    );
}

export default Reservation;
